import React from 'react';
import cart from "../assets/images/cart.png"

const NavBar = () => {
    return (
        <div className="container">
        <div className={"navbar"}>
            <p className="navbar__logo">Panto</p>
            <div className="navbar__nav">
                <a className="navbar__nav__item">Furniture</a>
                <a className="navbar__nav__item">Shop</a>
                <a className="navbar__nav__item">About us</a>
                <a className="navbar__nav__item">Contact</a>
            </div>
            div
            <img src={cart} alt="" className="navbar__cart"/>
        </div>
        </div>
    );
};

export default NavBar;
